import React from "react"; 
import Heading from "./Heading";
import Footer from "./Footer";
import Content from "./Content";
import NotedContent from "./NotedContent";
let App=()=>{
    return(
    <>
    <Heading/>
    <Content addnote={addItem}/><br/><br/>
    <NotedContent/>
    <Footer/>
    </>
    )
}
export default App;
